import React, {Component} from 'react';
import './App.css';
import SearchBar from './components/SearchBar';

class App extends Component {
  render() {
    return (
      <div className="App">
        <h1>App</h1>
        <SearchBar/>
      </div>
    );
  }
}

export default App;
